public class InnerWebACLFieldToMatchFactory(Action<Humidifier.WAFv2.WebACLTypes.FieldToMatch> factoryAction = null) : SubResourceFactory<Humidifier.WAFv2.WebACLTypes.FieldToMatch>
{

    internal InnerWebACLJsonBodyFactory JsonBodyFactory { get; set; }

    internal InnerWebACLJA3FingerprintFactory JA3FingerprintFactory { get; set; }

    internal InnerWebACLSingleQueryArgumentFactory SingleQueryArgumentFactory { get; set; }

    internal InnerWebACLHeadersFactory HeadersFactory { get; set; }

    internal InnerWebACLCookiesFactory CookiesFactory { get; set; }

    internal InnerWebACLBodyFactory BodyFactory { get; set; }

    internal InnerWebACLSingleHeaderFactory SingleHeaderFactory { get; set; }

    protected override Humidifier.WAFv2.WebACLTypes.FieldToMatch Create()
    {
        var fieldToMatchResult = CreateFieldToMatch();
        factoryAction?.Invoke(fieldToMatchResult);

        return fieldToMatchResult;
    }

    private Humidifier.WAFv2.WebACLTypes.FieldToMatch CreateFieldToMatch()
    {
        var fieldToMatchResult = new Humidifier.WAFv2.WebACLTypes.FieldToMatch();

        return fieldToMatchResult;
    }
    public override void CreateChildren(Humidifier.WAFv2.WebACLTypes.FieldToMatch result)
    {
        base.CreateChildren(result);

        result.JsonBody ??= JsonBodyFactory?.Build();
        result.JA3Fingerprint ??= JA3FingerprintFactory?.Build();
        result.SingleQueryArgument ??= SingleQueryArgumentFactory?.Build();
        result.Headers ??= HeadersFactory?.Build();
        result.Cookies ??= CookiesFactory?.Build();
        result.Body ??= BodyFactory?.Build();
        result.SingleHeader ??= SingleHeaderFactory?.Build();
    }

} // End Of Class

